    "aleutian-islands-national-wildlife-refuge-narrative-report-september-to-december-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Aleutian Islands
    National Wildlife Refuge outlines Refuge accomplishments from September to December
    of 1963. The report begins by summarizing the weather conditions, habitat conditions,
    and water conditions during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and wildfires. Resource management is outlined;
    topics include grazing and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, and
    violations. Items of interest, N-R forms, and photographs are attached",nt"license_title":
